import React, { Component } from 'react';
import Loadable from 'react-loadable';
import { connect } from 'react-redux';
import { withRouter } from 'react-router';
import { Route, Switch, NavLink } from 'react-router-dom';
import Button from '@material-ui/core/Button';

import { setMessage } from './Actions/appAction';

import './App.scss';

const AsyncPageDefault = Loadable({
  loader: () => import(/* webpackChunkName: "pageDefault" */ './PageDefault'),
  loading: () => <div>loading page...</div>,
  modules: ['pageDefault'],
});

const AsyncPageAnother = Loadable({
  loader: () => import(/* webpackChunkName: "pageAnother" */ './PageAnother'),
  loading: () => <div>loading another page...</div>,
  modules: ['pageAnother'],
});

class App extends Component {
  componentDidMount() {

  }

  test = () => {
    console.log('test');
  };

  render() {
    const { message } = this.props;
    return (
      <div className="App">
        {/*<header className="App-header">
          <img src="./images/logo.svg" className="App-logo" alt="logo" />
          <h1 className="App-title">Welcome to React</h1>
        </header>*/}
        <div className="App-intro">

          <h2>BTC CHART</h2>
          <nav>
            <NavLink to="/" exact activeClassName="active">
              Home
            </NavLink>
            <NavLink to="/searchBtc" activeClassName="active">
              Another page
            </NavLink>
          </nav>
          <Switch>
            <Route path="/" exact component={AsyncPageDefault} />
            <Route path="/searchBtc" component={AsyncPageAnother} />
          </Switch>
        </div>
      </div>
    );
  }
}

export default withRouter(
  connect(
    null,
    null,
  )(App),
);
